import React from "react";
/*
interface DataItem {
    id: string;
    app: string;
    name: string;
    supported_triggers: string;
    all_changes_deployed: string;
  }

  interface TableContainerProps {
    data: DataItem[];
  }
  */

interface TableContainerProps {
    data: string;
}

const Table: React.FC<TableContainerProps> = ({ data }) => {
    let jsonData = JSON.parse(data).report.actions;

    return (
    <div>
        <p>Table Container</p>
        <table>
            <thead>
                <tr>
                <th>Application</th>
                <th>Action</th>
                <th>Trigger</th>
                <th>Status</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>app 1</td>
                    <td>{jsonData[0].name}</td>
                    <td>{jsonData[0].supported_triggers}</td>
                    <td>{jsonData[0].all_changes_deployed}</td>
                </tr>
            </tbody>
        </table>
    </div>
    );
};

export default Table;
